class JSexecuter{code;constructor(code){this.code=code}run(){document.getElementById("scriptContainer")&&document.getElementById("scriptContainer").parentNode.removeChild(document.getElementById("scriptContainer"));let newScript=document.createElement("script");newScript.id="scriptContainer",newScript.text=`\n        try{\n            ${this.code}\n        }\n        catch(e){\n            Out(e);\n        }\n        `,document.body.appendChild(newScript)}}